script: |
  super -f text -I q1015.spq | sort > q1015.out

inputs:
  - name: q1015.spq
    data: |
      SELECT DISTINCT - COUNT ( col1 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 BETWEEN - 62 * + col0 - 13 - + - col1 * col0 * col2 - 52 * + 76 AND ( 34 * 74 );
  - name: tab0

outputs:
  - name: q1015.out
    data: |
      -1
